        public CrossRegionOps(ActivitySource source, DateTime startTime, string region)
        {
            this.source = source;
            this.StartTime = startTime;
            this.Region = region;
        }

        private static void ClearCoreSdkListeners()
        {
            Type defaultTrace = Type.GetType("Microsoft.Azure.Cosmos.Core.Trace.DefaultTrace,Microsoft.Azure.Cosmos.Direct");
            TraceSource traceSource = (TraceSource)defaultTrace.GetProperty("TraceSource").GetValue(null);
            traceSource.Switch.Level = SourceLevels.All;
            traceSource.Listeners.Clear();
        }

        private static async Task<Container> SetupAccountAsync(CosmosClient client)
        {
            DatabaseResponse dbResult = await client.CreateDatabaseIfNotExistsAsync(CrossRegionOps.DATABASE_NAME);
            ContainerResponse containerResult = await dbResult.Database.CreateContainerIfNotExistsAsync(new ContainerProperties
            {
                Id = CrossRegionOps.CONTAINER_NAME,
                PartitionKeyPath = "/id",
            },
            8000);

            await containerResult.Container.ReadContainerAsync();

            await containerResult.Container.CreateItemAsync(new { id = Guid.NewGuid().ToString() });

            return containerResult.Container;
        }

        private async Task WriteToFileBackgroundTask(CancellationToken cancellationToken)
        {
            Console.WriteLine($"Writing to file for region started: {this.Region}");
            while (!cancellationToken.IsCancellationRequested)
            {
                try
                {
                    await Task.Delay(TimeSpan.FromMinutes(1));
                    StringBuilder stringBuilder = new StringBuilder();
                    Console.WriteLine($"Writing to file for region: {this.Region}");

                    lock (this.createLatency)
                    {
                        if (this.createLatency.TotalCount > 0)
                        {
                            stringBuilder.AppendLine($"{{\"op\":\"create\",\"time\":\"{DateTime.UtcNow.ToString()}\",\"latency\": {{ \"p50\": \"{this.createLatency.GetValueAtPercentile(50) / 1_000_000} ms\",\"p90\":\"{this.createLatency.GetValueAtPercentile(90) / 1_000_000} ms\",\"p99\":\"{this.createLatency.GetValueAtPercentile(99) / 1_000_000} ms\",\"p99.9\":\"{this.createLatency.GetValueAtPercentile(99.9) / 1_000_000} ms\"}}}}");
                            this.createLatency.Reset();
                        }
                        else
                        {
                            stringBuilder.AppendLine($"{{\"op\":\"create\",\"time\":\"{DateTime.UtcNow.ToString()}\",\"latency\": {{ \"no operations\" }}}}");
                        }

                    }

                    lock (this.readLatency)
                    {
                        if (this.readLatency.TotalCount > 0)
                        {
                            stringBuilder.AppendLine($"{{\"op\":\"read\",\"time\":\"{DateTime.UtcNow.ToString()}\",\"latency\": {{ \"p50\": \"{this.readLatency.GetValueAtPercentile(50) / 1_000_000} ms\",\"p90\":\"{this.readLatency.GetValueAtPercentile(90) / 1_000_000} ms\",\"p99\":\"{this.readLatency.GetValueAtPercentile(99) / 1_000_000} ms\",\"p99.9\":\"{this.readLatency.GetValueAtPercentile(99.9) / 1_000_000} ms\"}}}}");
                            this.readLatency.Reset();
                        }
                        else
                        {
                            stringBuilder.AppendLine($"{{\"op\":\"read\",\"time\":\"{DateTime.UtcNow.ToString()}\",\"latency\": {{ \"no operations\" }}}}");
                        }
                    }

                    List<(int statusCode, string opId, string opType, CosmosDiagnostics diagnostics)> temp;
                    lock (this.diagnostics)
                    {
                        temp = this.diagnostics;
                        this.diagnostics = new(temp.Count);
                    }

                    foreach ((int statusCode, string opId, string opType, CosmosDiagnostics diag) in temp)
                    {
                        int failedRequestCount = diag.GetFailedRequestCount();
                        string regions = string.Join(';', diag.GetContactedRegions().Select(x=>x.regionName));
                        string failed = statusCode > 201 ? "true" : "false";
                        stringBuilder.AppendLine($"[{{\"op\":\"{opType}\",\"status\":{statusCode},\"id\":\"{opId}\",\"{regions}\",\"fail\":\"{failed}\",\"fail cnt\":{failedRequestCount}}}, {diag.ToString()}]");
                    }

                    string fileName = $"ppaf_diagnostics_{this.Region}_{this.StartTime:MM_dd_yy_H_mm_ss}.json";
                    await File.AppendAllTextAsync(fileName, stringBuilder.ToString());
                }
                catch (Exception ex)
                {
                    Console.WriteLine($"Exception for file writes: {ex.Message}");
                }
            }

            Console.WriteLine($"Writing to file for region ended: {this.Region}");
        }

        private async Task ParallelProcessing(Container container)
        {
            CancellationTokenSource cts = new CancellationTokenSource();
            List<Task> tasks = new List<Task>
            {
                this.WriteToFileBackgroundTask(cts.Token)
            };

            Console.WriteLine($"Starting the workload {this.Region}");
            for (int i = 0; i < CrossRegionOps.CONCURRENCY_PER_SDK_INSTANCE; i++)
            {
                tasks.Add(this.CreateAndReadItemAsync(container, this.Region, i, cts.Token));
            }


            await Task.Delay(CrossRegionOps.RUN_TIME);
            cts.Cancel();
            await Task.WhenAll(tasks);
            Console.WriteLine($"Workload completed {this.Region}");
        }

        private async Task CreateAndReadItemAsync(Container container, string region, int taskNum, CancellationToken cancellationToken)
        {
            int taskItemCount = 0;
            while (!cancellationToken.IsCancellationRequested)
            {
                taskItemCount++;
                string? sessionToken = null;

                int count = Interlocked.Increment(ref this.totalCount);
                if (taskItemCount % 50 == 0)
                {
                    Console.WriteLine($"Task {taskNum}; Total: {count}, {region}, Task Count: {taskItemCount}, time{DateTime.UtcNow:MM_dd_yy H_mm_ss}, create failed: {this.createFailureCount}, read failed: {this.readFailureCount}");
                }

                Item item = Item.CreateRandom();
                try
                {
                    using CancellationTokenSource cts = new CancellationTokenSource(TimeSpan.FromMinutes(5));
                    
                    string serializedItem = JsonSerializer.Serialize(item);
                    byte[] bytes = System.Text.Encoding.UTF8.GetBytes(serializedItem);
                    using MemoryStream stream = new MemoryStream(bytes);
                    CosmosDiagnostics createDiagonstics;
                    int createStatusCode = 0;
                    bool logDiagnostics = count % 50 == 0;
                    using (Activity? ac = this.source.CreateActivity("AppCreateItemStreamAsync", ActivityKind.Server))
                    {
                        Stopwatch sw = Stopwatch.StartNew();
                        using (ResponseMessage response = await container.CreateItemStreamAsync(stream, new PartitionKey(item.id), new ItemRequestOptions { EnableContentResponseOnWrite = false }, cts.Token))
                        {
                            sw.Stop();
                            lock (this.createLatency)
                            {
                                this.createLatency.RecordValue((long)sw.Elapsed.TotalNanoseconds);
                            }

                            createDiagonstics = response.Diagnostics;
                            createStatusCode = (int)response.StatusCode;

                            if (!response.IsSuccessStatusCode)
                            {
                                Interlocked.Increment(ref this.createFailureCount);
                            }

                            if (!response.IsSuccessStatusCode || logDiagnostics || sw.Elapsed.TotalSeconds >= 5)
                            {
                                lock (this.diagnostics)
                                {
                                    this.diagnostics.Add(((int)response.StatusCode, item.id, "CREATE", response.Diagnostics));
                                }

                                if (!response.IsSuccessStatusCode)
                                {
                                    continue;
                                }
                            }

                            sessionToken = response.Headers.Session;
                        }

                    }

                    // If read fails retry for 5mins.
                    do
                    {
                        int readStatusCode = await this.ReadItemHelper(container, sessionToken, logDiagnostics, item.id, cts);
                        if (readStatusCode == 200)
                        {
                            break;
                        }

                        // Read failed. Log create info and future reads.
                        if (logDiagnostics != true)
                        {
                            lock (this.diagnostics)
                            {
                                this.diagnostics.Add((createStatusCode, item.id, "CREATE", createDiagonstics));
                            }
                            logDiagnostics = true;
                        }

                    } while (!cancellationToken.IsCancellationRequested);
                }
                catch (CosmosOperationCanceledException oce)
                {
                    this.diagnostics.Add((-1, item.id, "CANCELED", oce.Diagnostics));
                }
                catch (Exception ex)
                {
                    Console.WriteLine($"Exception: {ex.Message}");
                }
            }
        }

        private async Task<int> ReadItemHelper(Container container, string? sessionToken, bool logDiagnostics, string itemId,  CancellationTokenSource cts)
        {
            using (Activity? ac = this.source.CreateActivity("AppReadItemStreamAsync", ActivityKind.Server))
            {
                Stopwatch sw = Stopwatch.StartNew();
                //Console.WriteLine($"sessionToken: {response.Headers.Session}; create: {item.createDateTime}; curr: {DateTime.UtcNow.ToString()}");
                using ResponseMessage readResponse = await container.ReadItemStreamAsync(id: itemId, partitionKey: new PartitionKey(itemId), requestOptions: new ItemRequestOptions()
                {
                    SessionToken = sessionToken
                }, cts.Token);

                sw.Stop();
                lock (this.readLatency)
                {
                    this.readLatency.RecordValue((long)sw.Elapsed.TotalNanoseconds);
                }

                if (!readResponse.IsSuccessStatusCode)
                {
                    Interlocked.Increment(ref this.readFailureCount);
                }

                if (!readResponse.IsSuccessStatusCode || readResponse.StatusCode == System.Net.HttpStatusCode.NotFound || logDiagnostics || sw.Elapsed.TotalSeconds > 5)
                {
                    lock (this.diagnostics)
                    {
                        this.diagnostics.Add(((int)readResponse.StatusCode, itemId, "READ", readResponse.Diagnostics));
                    }
                }

                return (int)readResponse.StatusCode;
            }
        }

        // Method to get all permutations of a list
        private static List<List<string>> GetRegionsPermutations(string writeRegion, List<string> readRegions)
        {
            List<List<string>> permutations = new List<List<string>>();
            List<string> writeAsPrimary = new List<string> { writeRegion };
            writeAsPrimary.AddRange(readRegions);
            permutations.Add(writeAsPrimary);

            for (int i = 0; i < readRegions.Count; i++)
            {
                List<string> permutation = new List<string>
                {
                    readRegions[i],
                    writeRegion
                };

                for (int j = 0; j < readRegions.Count; j++)
                {
                    if (j != i)
                    {
                        permutation.Add(readRegions[j]);
                    }
                }

                permutations.Add(permutation);
            }

            return permutations;
        }

